import React from "react";
import { fetchAllPlayers } from "./APIFetch";

export const PlayerList = (props) => {
   const {players, setPlayers} = props;

   return (
    <div>
        <table>
            <tr>
                <td>{players.name}</td>
                <td>{players.id}</td>
                <td><img src={players.imageUrl} /></td>
            </tr>
        </table>
    </div>
   )
}
